comment:
I hope an improved system of ECQ will be implemented by government.  I assume that they must have learned a lot from the current ECQ executed by them for more than a month now.  Something that fits the way of life for all Filipinos.  Why not let government pass a law with the following ordinance:
1.  All padre de pamilya will be held accountable for the safety of their family from Covid 19;
2.  ECQ will be strictly implemented on specific barangays only who have C19 infections;
3. Suspected carrier of C19 should wear a shirt where everybody will know her/his condition;
4.  Businesses should be opened ensuring every one should wear face mask and disposable gloves;
5.  Transients should be required to have a negative test of C19 before traveling to and from places;
6.  Government should learn how to manufacture C19 test kits and not rely on imports;
7. No more check points except for places like airports, sea ports, regional boundaries;
8.  Logistics should continue and should not be disrupted by police for businesses to flourish;
9. Business owners will held responsible and accountable that their establishments and staffs are C19 free;
10.  Public transports should adjust their load of passengers in conjunction with the current social distancing scheme;
11.  Hospitals should require their doctors to be present at all times;
12.  Massive test for C19.
